query savedSearchResultsQuery($_v0_ids: [String!]) {
  searchResults(ids: $_v0_ids) {
    id
    name
    url
    __typename
    ... on CompanyResultItem {
      tickerSymbol
      __typename
    }
    ... on EventResultItem {
      startTime
      endTime
      __typename
    }
    ... on VideoResultItem {
      timestamp
      __typename
    }
    ... on ResearchArticleResultItem {
      timestamp
      authorName
      authorTitle
      type
      __typename
    }
  }
}
